import React from 'react'
import Aux from '../../hoc/Aux.js'
import classes from '.Layout.css'
const layout=(props)=>(
    <Aux>
    <div>toolbar,sidedrawer,backdrop</div>
    <main className={classes.content}>
        {props.children}
    </main>
    </Aux>
);
export default layout;
